","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null,null,null,null,null,null,null,null,null,null,null,null,null,null,"/R/testStatistic.R","/R/selectiveModel.R",null,"/R/selectiveModel.R",null]},"interval":10,"files":[{"filename":"/R/selectiveModel.R","content":"#' Selected model inference\n#'\n#' Fits a changepoint model using \\code{fit_method} to \\code{y}. The returned\n#' model needs to have a function defined via the generic function\n#' \\code{binSeg::polyhedra}. Inference is performed by sampling data from the\n#' null distribution matching the estimated changepoint model\n#' where each sample is drawn from a Gaussian and matches\n#' in empirical means in each segment and in L2-norm (the sufficient statistics).\n#'\n#' Currently the test is a 2-sided test.\n#'\n#' The \\code{test_func} should be a function that takes in \\code{y} as the first\n#' input and the output of \\code{fit_method} as the second input, and \\code{...}\n#' as the third input.\n#'\n#' If \\code{sigma} is \\code{NA}, then the function conditions on \\code{.l2norm(y)}.\n#' Otherwise, \\code{sigma} represents the standard deviation of the marginal distribution\n#' of \\code{y}, asserting that each coordinate is independent and Gaussian.\n#'\n#' @param y data of length n\n#' @param fit_method function to fit changepoint model\n#' @param test_func function to apply to each \\code{y} and fitted model\n#' @param num_samp number of desired samples from null distribution\n#' @param sample_method either \\code{hit_run} or \\code{rejection}\n#' @param sigma postive number or \\code{NA}.\n#' @param ignore_jump which jump to ignore\n#' @param param additional parameters for \\code{sample_method} passed in as a list\n#' @param cores number of cores, only for rejection sampling\n#' @param verbose boolean\n#' @param ... optional inputs for \\code{test_func}\n#'\n#' @return quantile\n#' @export\nselected_model_inference <- function(y, fit_method,\n                                     test_func = next_jump_statistic,\n                                     num_samp = 100,\n                                     sample_method = \"hitrun\",\n                                     sigma = NA,\n                                     ignore_jump = NA,\n                                     param = list(burn_in = default_burn_in(),\n                                                  lapse = default_lapse()),\n                                     cores = 1, verbose = T, ...){\n\n  #fit the model, fit polyhedra, and compute test statistic on the observed model\n  n <- length(y)\n  fit <- fit_method(y)\n  polyhedra <- binseginf::polyhedra(fit)\n  test_stat <- test_func(y, fit, jump = ignore_jump, ...)\n\n  #prepare sampler\n  segments <- .segments(n, binseginf::jumps(fit), ignore_jump = ignore_jump)\n  param <- .fill_in_arguments(param)\n\n  #pass to sampler\n  if(is.na(sigma)) {\n    if(sample_method == \"hitrun\") {\n      samples <- .sampler_hit_run_radial(y, segments, polyhedra, num_samp = num_samp,\n                                         burn_in = param$burn_in, lapse = param$lapse,\n                                         verbose = verbose)\n    } else {\n      stop(\"sample_method not appropriate\")\n    }\n  } else {\n    if(sample_method == \"hitrun\") {\n      gaussian <- .gaussian(rep(0, n), sigma^2*diag(n))\n      samples <- .sampler_hit_run_line(y, gaussian, segments, polyhedra, num_samp = num_samp,\n                                       burn_in = param$burn_in)\n    } else {\n      stop(\"sample_method not appropriate\")\n    }\n  }\n\n  #for each sample, run the test function\n  null_stat <- apply(samples, 2, function(x){\n    test_func(x, fit, jump = ignore_jump, ...)\n  })\n\n  #compute the quantile\n  pval <- length(which(abs(null_stat) >= abs(test_stat)))/length(null_stat)\n\n  list(pval = pval, test_stat = test_stat, null_stat = null_stat)\n}\n\n#' Compute the matrix of segments\n#'\n#' Return a matrix \\code{mat} such that\n#' for a data vector \\code{y}, we have\n#' \\code{mat %*% y} would output the empirical means of each segment of \\code{y}\n#' according to \\code{jump_vec}.\n#'\n#' \\code{jump_vec} is a vector of indices (not necessarily in any particular\n#' order) less than or equal to \\code{n}. A value of \\code{i} in \\code{jump_vec}\n#' denotes that there is jump between index \\code{i} and \\code{i+1}.\n#' \\code{jump_vec} does not need to include \\code{n}.\n#'\n#' @param n number of samples\n#' @param jump_vec vector of indices\n#' @param ignore_jump which jump to ignore\n#'\n#' @return s-row matrix, where s is equal to \\code{length(jump_vec+1)}\n.segments <- function(n, jump_vec, ignore_jump = NA){\n  if(all(is.na(jump_vec))) return(matrix(rep(1/n,n), nrow = 1))\n\n  stopifnot(all(jump_vec >= 1), all(jump_vec <= n), all(jump_vec %% 1 == 0))\n  jump_vec <- sort(jump_vec)\n  if(!is.na(ignore_jump)){\n    stopifnot(ignore_jump %% 1 == 0, ignore_jump > 0, ignore_jump <= length(jump_vec))\n    jump_vec <- jump_vec[-ignore_jump]\n  }\n  jump_vec <- unique(sort(c(0,jump_vec, n)))\n\n  len <- length(jump_vec)\n  mat <- sapply(1:(len-1), function(x){\n    vec <- rep(0, n)\n    vec[(jump_vec[x]+1):jump_vec[(x+1)]] <- 1/(jump_vec[x+1]-jump_vec[x])\n    vec\n  })\n\n  t(mat)\n}\n\n#' Computes the empirical mean of each segment\n#'\n#' @param y data\n#' @param segments matrix created by \\code{.segments}\n#'\n#' @return vector\n.segment_means <- function(y, segments){\n  stopifnot(!is.matrix(y), length(y) == ncol(segments))\n  as.numeric(segments %*% y)\n}\n\n.l2norm <- function(vec){\n  as.numeric(sqrt(sum(vec^2)))\n}\n\n.fill_in_arguments <- function(param){\n  burn_in <- ifelse(!is.null(param$burn_in), param$burn_in, default_burn_in())\n  lapse <- ifelse(!is.null(param$lapse), param$lapse, default_lapse())\n\n  list(burn_in = burn_in, lapse = lapse)\n}\n\n#' Default burn in\n#'\n#' @return numeric\n#' @export\ndefault_burn_in <- function(){2000}\n\n#' Default lapse\n#'\n#' @return numeric\n#' @export\ndefault_lapse <- function(){2}\n","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/selectiveModel.R"},{"filename":"/R/hitrun_radial.R","content":"#' Hit and run sampler, Radial\n#'\n#' For unknown sigma\n#'\n#' @param y data\n#' @param segments matrix created by \\code{.segments}\n#' @param polyhedra \\code{polyhedra} object\n#' @param num_samp number of desired samples from null distribution\n#' @param cores umber of cores\n#' @param burn_in positive integer of the first few samples to throw out per core\n#' @param lapse positive integer, where we sample \\code{num_samp*burn_in}\n#' samples from the null distribution and return every \\code{burn_in}th sample\n#' @param verbose boolean\n#'\n#' @return matrix with \\code{num_samp} columns and \\code{length(y)} rows\n.sampler_hit_run_radial <- function(y, segments, polyhedra, num_samp = 100,\n                                    burn_in = 500, lapse = 2, verbose = F){\n  num_col <- burn_in + num_samp*lapse\n  y_mat <- matrix(NA, nrow = length(y), ncol = num_samp)\n  seq_idx <- burn_in + (1:num_samp)*lapse\n  prev_y <- y\n\n  for(i in 1:num_col){\n    next_y <- .hit_run_next_point_radial(prev_y, segments, polyhedra)\n    if(i %in% seq_idx){\n      y_mat[,which(seq_idx == i)] <- next_y\n    }\n\n    prev_y <- next_y\n  }\n\n  stopifnot(all(.try_polyhedra(y_mat, polyhedra)))\n  y_mat\n}\n\n#' Output the next point for hit-and-run sampler, Radial\n#'\n#' For unknown sigma\n#'\n#' @param y data\n#' @param segments matrix created by \\code{.segments}\n#' @param polyhedra \\code{polyhedra} object\n#'\n#' @return vector\n.hit_run_next_point_radial <- function(y, segments, polyhedra){\n  stopifnot(ncol(segments) == length(y))\n\n  tmp <- .sample_matrix_space(segments, 2, null = T)\n  v <- tmp[,1]; w <- tmp[,2]\n  interval <- .range_theta_polyhedra(y, v, w, polyhedra)\n\n  if(nrow(interval) == 1) {\n    theta <- stats::runif(1, interval[1], interval[2])\n  } else {\n    len <- interval[,2] - interval[,1]\n    row_idx <- sample(1:nrow(interval), 1, prob = len)\n    theta <- stats::runif(1, interval[row_idx,1], interval[row_idx,2])\n  }\n\n  y_new <- .radians_to_data(theta, y, v, w)\n\n  stopifnot(.try_polyhedra(y_new, polyhedra))\n\n  y_new\n}\n","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/hitrun_radial.R"},{"filename":"/R/RcppExports.R","content":"# Generated by using Rcpp::compileAttributes() -> do not edit by hand\n# Generator token: 10BE3573-1514-4C36-9D1C-5A225CD40393\n\n.c_initial_theta <- function(y, v, w) {\n    .Call(`_selectiveModel_c_initial_theta`, y, v, w)\n}\n\n.c_basic_interval <- function(endpoints, theta) {\n    .Call(`_selectiveModel_c_basic_interval`, endpoints, theta)\n}\n\n.c_partition_interval <- function(interval) {\n    .Call(`_selectiveModel_c_partition_interval`, interval)\n}\n\n.c_interval <- function(endpoints, initial_theta) {\n    .Call(`_selectiveModel_c_interval`, endpoints, initial_theta)\n}\n\n.c_form_interval <- function(a, b, y, v, w) {\n    .Call(`_selectiveModel_c_form_interval`, a, b, y, v, w)\n}\n\n.c_l2norm <- function(vec) {\n    .Call(`_selectiveModel_c_l2norm`, vec)\n}\n\n.c_quadratic <- function(a, b, c) {\n    .Call(`_selectiveModel_c_quadratic`, a, b, c)\n}\n\n.c_unique_sort_native <- function(x) {\n    .Call(`_selectiveModel_c_unique_sort_native`, x)\n}\n\n.c_construct_midpoints <- function(x) {\n    .Call(`_selectiveModel_c_construct_midpoints`, x)\n}\n\n.c_which_native <- function(x) {\n    .Call(`_selectiveModel_c_which_native`, x)\n}\n\n.c_consecutive_true <- function(vec) {\n    .Call(`_selectiveModel_c_consecutive_true`, vec)\n}\n\n.c_unlist_native <- function(list) {\n    .Call(`_selectiveModel_c_unlist_native`, list)\n}\n\n.c_theta_in_matrix <- function(x, mat) {\n    .Call(`_selectiveModel_c_theta_in_matrix`, x, mat)\n}\n\n.c_theta_in_all_matrix <- function(x, list) {\n    .Call(`_selectiveModel_c_theta_in_all_matrix`, x, list)\n}\n\n.c_intersect_intervals <- function(list) {\n    .Call(`_selectiveModel_c_intersect_intervals`, list)\n}\n\n.c_intersect_circle_tester <- function(a, b, center, radius) {\n    .Call(`_selectiveModel_c_intersect_circle_tester`, a, b, center, radius)\n}\n\n.c_intersect_basis_tester <- function(a, b, y, v, w) {\n    .Call(`_selectiveModel_c_intersect_basis_tester`, a, b, y, v, w)\n}\n\n.c_euclidean_to_radian_tester <- function(center, radius, point) {\n    .Call(`_selectiveModel_c_euclidean_to_radian_tester`, center, radius, point)\n}\n\n.c_gibbs_step <- function(state, direction, U, alpha) {\n    invisible(.Call(`_selectiveModel_c_gibbs_step`, state, direction, U, alpha))\n}\n\n.c_sample_truncnorm_white <- function(state, U, directions, alphas, burnin, ndraw) {\n    .Call(`_selectiveModel_c_sample_truncnorm_white`, state, U, directions, alphas, burnin, ndraw)\n}\n\n","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/RcppExports.R"},{"filename":"/R/radians.R","content":"#' Find the range of theta's that are in the polyhedra\n#'\n#' Finds theta's such that for each theta,\n#' \\code{.radians_to_data(theta, y, v, w)} is inside the polyhedra.\n#'\n#' @param y vector\n#' @param v unit vector\n#' @param w unit vector orthogonal to \\code{v}\n#' @param polyhedra \\code{polyhedra} object\n#'\n#' @return vector of possible theta's\n.range_theta_polyhedra <- function(y, v, w, polyhedra){\n  stopifnot(.try_polyhedra(y, polyhedra))\n  stopifnot(abs(.l2norm(v) - 1) < 1e-4,  abs(.l2norm(w) - 1) < 1e-4, abs(v%*%w) < 1e-4)\n\n  interval_list <- lapply(1:nrow(polyhedra$gamma), function(x){\n    .c_form_interval(polyhedra$gamma[x,], polyhedra$u[x], y, v, w)\n  })\n\n  interval <- .c_intersect_intervals(interval_list)\n  stopifnot(all(interval[,1] < interval[,2]))\n\n  interval\n}\n\n#' Radius function\n#'\n#' @param theta radians\n#' @param y vector\n#' @param v unit vector\n#' @param w unit vector orthogonal to \\code{v}\n#'\n#' @return numeric\n.radius <- function(theta, y, v, w){\n  -2*as.numeric(t(y)%*%(v*sin(theta)+w*cos(theta)))\n}\n\n#' Convert radians into a sample\n#'\n#' @param theta radians\n#' @param y vector\n#' @param v unit vector\n#' @param w unit vector orthogonal to \\code{v}\n#'\n#' @return vector with length of \\code{length(y)}\n.radians_to_data <- function(theta, y, v, w){\n  y + .radius(theta, y, v, w)*(sin(theta)*v + cos(theta)*w)\n}\n\n#' Determine if each y is in polyhedra\n#'\n#' @param y_mat matrix where each column represents a different sample, or\n#' a vector\n#' @param polyhedra \\code{polyhedra} object\n#'\n#' @return vector of booleans, one for each column of \\code{y_mat} (or just one)\n.try_polyhedra <- function(y_mat, polyhedra){\n  if(is.matrix(y_mat)){\n    stopifnot(ncol(polyhedra$gamma) == nrow(y_mat))\n  } else {\n    stopifnot(ncol(polyhedra$gamma) == length(y_mat))\n  }\n\n  res <- polyhedra$gamma %*% y_mat\n\n  if(is.matrix(y_mat)){\n    sapply(1:ncol(res), function(x){all(res[,x] >= polyhedra$u)})\n  } else {\n    all(res >= polyhedra$u)\n  }\n}\n","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/radians.R"},{"filename":"/R/linalg.R","content":"#' Projection of vector onto another vector\n#'\n#' Returns the component of \\code{vec1} that is orthogonal to \\code{vec2}\n#'\n#' @param vec1 vector\n#' @param vec2 vector\n#' @param tol small positive number\n#'\n#' @return vector\n.projection <- function(vec1, vec2, tol = 1e-6){\n  stopifnot(length(vec1) == length(vec2))\n\n  d <- length(vec1)\n  vec2 <- vec2/.l2norm(vec2)\n  as.numeric((diag(d) - vec2%*%t(vec2))%*%vec1)\n}\n\n#' Projection of vector onto rows of a matrix\n#'\n#' Returns the component of \\code{vec} that is orthogonal to all the rows\n#' of \\code{mat}\n#'\n#' @param vec vector\n#' @param mat matrix\n#'\n#' @return vector\n.projection_matrix <- function(vec, mat){\n  stopifnot(length(vec) == ncol(mat), ncol(mat) >= nrow(mat))\n  n <- length(vec)\n  proj_mat <- diag(n) - t(mat) %*% solve(mat %*% t(mat)) %*% mat\n\n  as.numeric(proj_mat %*% vec)\n}\n\n#' Sample unit vectors from the null space of a matrix\n#'\n#' This function assumes the row space of \\code{mat} is the number of\n#' rows in \\code{mat}. If \\code{num_vec} is \\code{NA}, then the function\n#' construct a basis for the entire null space of \\code{mat}, which is\n#' assumed to have dimension equal to the rank of \\code{mat}.\n#'\n#' If \\code{null} is \\code{TRUE}, then this function samples from the nullspace.\n#' Otherwise, sample from the rowspace.\n#'\n#' @param mat matrix\n#' @param num_vec positive integer or \\code{NA}\n#' @param null boolean\n#'\n#' @return a matrix of vectors, with number of rows equal to \\code{ncol(mat)}\n#' and number of columns equal to \\code{num_vec}\n.sample_matrix_space <- function(mat, num_vec = NA, null = T){\n  k <- Matrix::rankMatrix(mat)\n  n <- ncol(mat)\n\n  # form basis of either rowspace or nullspace\n  if(null){\n    res <- matrix(stats::rnorm(n*(n-k)), ncol = n-k)\n    res <- apply(res, 2, .projection_matrix, mat = mat)\n    res <- svd(t(res))$v\n  } else {\n    res <- svd(mat)$v\n  }\n\n  if(is.na(num_vec)) return(res)\n\n  weights <- matrix(stats::rnorm(num_vec*ncol(res)), nrow = ncol(res))\n  vec_mat <- res %*% weights\n\n  #make the vectors orthogonal\n  if(num_vec > 1){\n    for(i in 2:num_vec){\n      vec_mat[,i] <- .projection_matrix(vec_mat[,i], mat = t(vec_mat[,1:(i-1), drop = F]))\n    }\n  }\n\n  sapply(1:ncol(vec_mat), function(x){vec_mat[,x]/.l2norm(vec_mat[,x])})\n}\n","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/linalg.R"},{"filename":"/R/testStatistic.R","content":"#' Compute the next jump for a \\code{bsFs} object\n#'\n#' @param obj \\code{bsFs} object\n#' @param y data\n#' @param ... additional parameters\n#'\n#' @return \\code{bsFs} object with one more jump\n#' @export\nnext_jump.bsfs <- function(obj, y, ...){\n  num_steps <- obj$numSteps\n  binseginf::bsfs(y, num_steps+1)\n}\n\n#' Compute distance of next jump\n#'\n#' \\code{jump_vec} is a vector of indices (not necessarily in any particular\n#' order) less than or equal to \\code{n}. A value of \\code{i} in \\code{jump_vec}\n#' denotes that there is jump between index \\code{i} and \\code{i+1}.\n#' \\code{jump_vec} does not need to include \\code{n}.\n#'\n#' @param y data\n#' @param jump_vec_before vector of indices\n#' @param jump_vec_after vector of indices with exactly one additional element\n#' compared to \\code{jump_vec_before}\n#'\n#' @return positive numeric\n.jump_contrast <- function(y, jump_vec_before, jump_vec_after){\n  new_jump <- jump_vec_after[which(!jump_vec_after %in% jump_vec_before)]\n  stopifnot(length(new_jump) == 1)\n\n  n <- length(y)\n  jump_sorted <- c(0, sort(jump_vec_after), n)\n  idx <- which(jump_sorted == new_jump)\n  stopifnot(idx != n)\n  interval_left <- (jump_sorted[idx-1]+1):jump_sorted[idx]\n  interval_right <- (jump_sorted[idx]+1):jump_sorted[idx+1]\n\n  mean(y[interval_right]) - mean(y[interval_left])\n}\n\n#' Test statistic for testing empirical size of next jump\n#'\n#' @param y data\n#' @param fit changepoint fitted model\n#' @param ... nothing\n#'\n#' @return numeric\n#' @export\nnext_jump_statistic <- function(y, fit, ...){\n  next_fit <- next_jump(fit, y)\n  .jump_contrast(y, binseginf::jumps(fit), binseginf::jumps(next_fit))\n}\n\n#' Compute the height of a specific jump\n#'\n#' \\code{jump_number} refers to the \\code{jump_number}th jump starting from\n#' the left. This function outputs the difference between the mean of \\code{y}\n#' to the left and to the right of that jump (right minus left)\n#'\n#' @param y data vector\n#' @param fit fitted changepoint object\n#' @param jump positive integer\n#' @param ... not used\n#'\n#' @return numeric\n#' @export\nsegment_difference <- function(y, fit, jump = 1, ...){\n  stopifnot(jump %% 1 == 0, jump > 0)\n\n  jumps <- sort(binseginf::jumps(fit))\n  stopifnot(jump <= length(jumps))\n  jump_idx <- jumps[jump]\n  stopifnot(jump_idx < length(y))\n\n  jumps <- sort(unique(c(0, jumps, length(y))))\n  idx <- which(jumps == jump_idx)\n  stopifnot(idx != 1)\n\n  mean(y[(jumps[idx]+1):jumps[idx+1]]) -\n    mean(y[(jumps[idx-1]+1):jumps[idx]])\n}\n","normpath":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/R/testStatistic.R"}],"prof_output":"/Users/kevinlin/Dropbox/Collaboration and People/Justin_Kevin_Max_Ryan/selectiveModel/selectiveModel/.Rproj.user/E62C6A16/profiles-cache/file9a534f3ee435.Rprof","highlight":{"output":["^output\\$"],"gc":["^<GC>$"],"stacktrace":["^\\.\\.stacktraceo(n|ff)\\.\\.$"]},"split":"h"}},"evals":[],"jsHooks":[]}</script>
